import React from 'react';

import classes from './Medidas.module.css'

const Medidas = (props) => {

    const form =props.medidas.map( (item, i) =>
        console.log(item.altura, i)
    );
    //        return <label key={medida[prop]}><span>medida[prop]</span><span> </span><span>medida[prop]</span><span>medida[prop]</span><input type="checkbox"  value="x"/></label>

    return ( 
        <div className={classes.Medidas}>
            <h2>Medidas</h2>
            <form>
               {form}
            </form>
        </div>
     );
}
 
export default Medidas;
